import React,{useState} from 'react';
import './App.css';
import { GameForm } from './GameForm/EntryPoint';
import { PlayForm } from './PlayForm/EntryPoint';


function App() {
  const [visible,setVisible] = useState<boolean>(true);

  const state = {
    visual: true
  }
  console.log(state.visual)
  if(state.visual){
    return (
      <div className="">
        <GameForm visible={visible} setVisible={setVisible} visual={state.visual}/>
      </div>
    );
  }
  return (
    <div className="">
      <GameForm visible={visible} setVisible={setVisible} visual={state.visual}/>
      <PlayForm visible={visible} setVisible={setVisible} visual={state.visual}/>
    </div>
  );
}

export default App;
